import React, { useEffect, useState } from 'react';
import './Home.css';

function ImageSlider() {
  const [slideIn, setSlideIn] = useState(false);

  useEffect(() => {
    setSlideIn(true);
  }, []);

  return (
    <div className="image-slider">
      <img
        src="your-image-url"
        alt="Sliding Image"
        className={slideIn ? 'slide-in' : ''}
      />
    </div>
  );
}

export default ImageSlider;
